import React from "react";



export default function Paged({pokePerPage, pokemons, paged}){
    let pagedNumber = [];
    for( let i = 0; i < Math.ceil(pokemons/pokePerPage); i++){
        pagedNumber.push(i)
    }

    return (
        <footer>
            <ul>
                { pagedNumber && pagedNumber.map(number => {
                    <li key={number}>
                    <a onClick={() => paged(pagedNumber)}>{number}</a>
                    </li>
                })}

            </ul>


        </footer>

    )
}
